from urllib.parse import urlparse, parse_qs

# The URL you want to parse
url = "https://shopee.vn/app?redir=https%3A%2F%2Fshopee.vn%2Fproduct%2F286157142%2F9212069606%3Fd_id%3D9dea6%26smtt%3D0.117835879-1666671971.9%26utm_campaign%3D-%26utm_content%3Dproduct%26utm_medium%3Daffiliates%26utm_source%3Dan_17358790000%26utm_term%3Dbb2ivgx4ey35#home?%3D&anr_improv=true&d_id=9dea6&smtt=0.117835879-1666671971.9&utm_campaign=-&utm_content=product&utm_medium=affiliates&utm_source=an_17358790000&utm_term=bb2ivgx4ey35"

# Parse the URL
parsed_url = urlparse(url)

# Extract the query parameters
query_params = parse_qs(parsed_url.query)

# Get the 'redir' parameter
redir_url = query_params.get('redir')

# Print the redir URL
print(redir_url)
